import "./Comments.scss"

function Comments(props) {
    console.log(props)
    return(
        <>
        <div>
        <ul>
            {props.Comments.comments.map((item) => {
                return(
                    <>
                    <li className="list" key={item.id}>
                        <p>{item.name}</p>
                        <p>{item.comment}</p>
                        {/* <p>{item.likes}</p> */}
                        <p>{item.timestamp}</p>
                    </li>
                    </>
                )
            })}

        </ul>
        </div>
        </>

    )
}

export default Comments

